export default {
  increment({
    commit,
    state
  }) {
    // 此处提交的事件与下方 mutations 中的 types.INCREMENT 对应
    //与原来 commit('increment') 的原理相同，只是把类型名换成了常量
    commit('increment')
  },
  decrement({
    commit,
    state
  }) {
    if (state.count > 10) {
      // 此处提交的事件与下方 mutations 中的 types.DECREMENT 对应
      commit('decrement')
    } else {
      console.log('小于10不能减少')
    }
  },
  // ossConfig
  updateOssConfig({
    commit
  }, data) {
    commit('updateOssConfig', data)
  },
  // 设置用户信息
  setUserInfo({
    commit
  }, data) {
    commit('setUserInfo', data)
  },
  // 设置用户详细信息
  setUserDetailInfo({
    commit
  }, data) {
    commit('setUserDetailInfo', data)
  },
  // 设置当前选择银行
  setBank({
    commit
  }, data) {
    commit('setBank', data)
  },
  // 更新用户信息
  updateUser({
    commit
  }, data) {
    commit('updateUser', data)
  },
  // 清除信息
  clearAll({
    commit
  }, data) {
    commit('clearAll', data)
  },
  // 设置微信用户信息 wechatInfo
  setWechatInfo({
    commit
  }, data) {
    commit('setWechatInfo', data)
  },
}
